import React from 'react';
import './App.css';

import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
    },
  },
}));

function App() {
  return (
    <div className="App">
      <HomeElement />
    </div>
  );
}

let HomeElement = () => {

  const classes = useStyles();

  return (

    <div className={classes.root}>
      <Button variant="outlined">Get Current Data</Button>
      <Button variant="outlined" color="primary">Change Configuration</Button>

    </div>
  );
}



export default App;
